import React from "react";
import "./App.scss";

import Clock from "./components/clock/clock";
import Game from "./components/propsGame/Game";
import AxiosHook from "./axios";
function App() {
  return (
    <div className='App'>
      <p>Miklo \ Chicago, IL \ 312</p>
      <Clock />
      <AxiosHook />
      <Game />
    </div>
  );
}

export default App;
